const BaseButtons = ({firstContent, secondContent, handleBase64}) => {

  return (
    <div className="button-group">
      <button className="base-button" onClick={handleBase64(firstContent)}>
        Decode
      </button>
      <button className="base-button" onClick={handleBase64(secondContent)}>
        Encode
      </button>
    </div>
  );
};

export default BaseButtons;
